INSERT INTO `dashboard_settings` (`id`, `titolo`, `sottotitolo`, `testo`, `stato_GA`, `favicon`, `logo`, `db_version`, `dashboard_version`, `data_pubblicazione`, `created_by`, `data_creation`, `status`) VALUES
(1, 'Lapsic', 'Gestionale Lapsic', '<p><strong>TERMINI E CONDIZIONI LAPSIC</strong></p>\r\n\r\n<p>Accedendo al sito Web di Lapsic, al servizio di Lapsic o a qualunque applicazione (incluse le applicazioni mobili) che Lapsic mette a disposizione (collettivamente i &quot;Servizi&quot;) o utilizzando uno di essi, l&#39;utente accetta di essere vincolato dalle presenti condizioni d&#39;uso (&quot;Condizioni d&#39;uso&quot;). I Servizi sono di propriet&agrave; di Lapsic o da esso controllati.&nbsp;<strong>Le presenti Condizioni d&#39;uso determinano i diritti e gli obblighi legali dell&#39;utente. Qualora l&#39;utente non accetti tutte le presenti Condizioni d&#39;uso, non dovr&agrave; accedere ai servizi n&eacute; utilizzarli.</strong><br />\r\n<br />\r\nIn alcune occasioni potremmo offrire una funzione speciale che prevede termini e condizioni proprie applicabili in aggiunta alle presenti Condizioni d&#39;uso. In tali casi, i termini specifici per la funzione speciale prevarranno nella misura in cui sussista un conflitto con le presenti Condizioni d&#39;uso.<br />\r\n<br />\r\n<strong>Condizioni relative all&#39;arbitrato: eccezion fatta per la rinuncia da parte dell&#39;utente e &nbsp;salvo alcuni tipi di controversie descritte nella sezione relativa all&#39;arbitrato di seguito riportata, l&#39;utente accetta che le eventuali controversie tra l&#39;utente e Lapsic vengano risolte tramite arbitrato individuale vincolante ed altres&igrave; rinuncia al diritto di prendere parte a una causa collettiva o a un arbitrato collettivo.</strong></p>\r\n\r\n<p>Termini di base</p>\r\n\r\n<ol>\r\n	<li>L&rsquo;utilizzo dei Servizi &egrave; riservato agli utenti che abbiano compiuto almeno 12 anni.</li>\r\n	<li>&Egrave; proibito pubblicare su Lapsic immagini, video od altri contenuti violenti, discriminatori (sia per razza che per orientamento sessuale o religioso) con nudit&agrave; totali o parziali, illegali, illeciti, contenenti messaggi di odio, incitamento all&rsquo;odio, pornografici o con evidenti allusioni sessuali.</li>\r\n	<li>L&#39;utente &egrave; responsabile di ogni attivit&agrave; che avviene all&#39;interno del proprio account e accetta di non vendere, trasferire, concedere su licenza o assegnare a terzi il proprio account, i suoi followers, il nome utente o qualunque diritto sull&#39;account. Ad eccezione delle persone o delle aziende espressamente autorizzate a creare account a nome dei propri datori di lavoro o clienti, Lapsic ne proibisce la creazione e l&#39;utente accetta di non creare un account eccetto che per se stesso. L&#39;utente dichiara inoltre che tutte le informazioni fornite a Lapsic al momento della registrazione e in ogni altro momento sono vere, accurate, aggiornate e complete, e accetta altres&igrave; di aggiornare le informazioni secondo necessit&agrave; al fine di garantirne la veridicit&agrave; e l&#39;accuratezza.</li>\r\n	<li>L&#39;utente accetta espressamente di non chiedere, raccogliere o utilizzare, rivendere, distribuire, le credenziali di accesso personali di altri utenti di Lapsic.</li>\r\n	<li>L&#39;utente ha la responsabilit&agrave; e dovere di tenere segreta e sicura la propria password di accesso.</li>\r\n	<li>&Egrave; vietato intimidire, minacciare, perseguitare, abusare, infastidire, impersonare &nbsp;persone o entit&agrave; ed &egrave; inoltre vietato pubblicare foto su Lapsic aventi &nbsp;informazioni private o riservate, inclusi, tra gli altri, dati di carte di credito, numeri di carte di identit&agrave;, codici fiscali o altri numeri identificativi nazionali, indirizzi privati o informazioni sulla posizione, numeri di telefono non pubblici, indirizzi e-mail non pubblici, propri o altrui.</li>\r\n	<li>&Egrave; vietato utilizzare i Servizi per qualunque scopo illecito o non autorizzato. L&#39;utente accetta di adeguarsi a tutte le leggi, regolamentazioni e normative (ad esempio, federali, statali, locali e provinciali) applicabili all&#39;utilizzo dei Servizi e dei Contenuti (come definiti di seguito), incluse, tra l&#39;altro, le leggi sul copyright e sulla propriet&agrave; intellettuale.</li>\r\n	<li>L&#39;utente &egrave; l&rsquo;unico responsabile del proprio comportamento e di tutti i testi, dati, file, informazioni, nomi utente, immagini, grafici, foto, profili, audio e videoclip, suoni, composizioni musicali, opere di propriet&agrave; intellettuale, applicazioni, link e altri contenuti o materiali (collettivamente, i &quot;Contenuti&quot;) inviati, pubblicati o mostrati su Lapsic o tramite esso.</li>\r\n	<li>&Egrave; vietato alterare, modificare, adattare o cambiare i Servizi, nonch&eacute; cambiare, modificare o alterare altri siti Web per sottintendere fraudolentemente che siano associati ai Servizi o a Lapsic.</li>\r\n	<li>&Egrave; proibito accedere all&rsquo;account&nbsp; privato di Lapsic con mezzi diversi da quelli consentiti da Lapisc stessa.</li>\r\n	<li>&Egrave; vietato creare o inviare e-mail, commenti, apprezzamenti indesiderati ed altre forme di comunicazione commerciale o molesta (dette anche &quot;spam&quot;) a tutti gli utenti di Lapsic.</li>\r\n	<li>&Egrave; proibito interferire o compromettere i Servizi, i server o le reti collegati ai Servizi, incluso tramite la trasmissione di qualsiasi forma di worm, virus, spyware, malware o altro codice&nbsp; distruttivo od intrusivo. &Egrave; vietato iniettare contenuti o codici &nbsp;nonch&eacute; alterare o interferire in altro modo con la modalit&agrave; di resa o visualizzazione della pagina di Lapsic sul dispositivo di un utente o browser dello stesso.</li>\r\n	<li>&Egrave; necessario conformarsi alle Linee guida della comunit&agrave; di Lapsic.</li>\r\n	<li>&Egrave; vietato generare profili Lapsic attraverso mezzi non autorizzati, incluso, a titolo esemplificativo e non esaustivo, l&#39;uso di dispositivi, script, bot, spider, crawler o scraper automatizzati.</li>\r\n	<li>&Egrave; proibito impedire od ostacolare un utente nell&rsquo;utilizzo dei servizi Lapsic ed &egrave; altres&igrave; vietato incoraggiare o incentivare violazioni delle presenti Condizioni d&#39;uso o di altri termini di Lapsic.</li>\r\n	<li>L&#39;inosservanza delle presenti Condizioni d&#39;uso potr&agrave; portare, a <strong>esclusiva discrezione di Lapsic</strong>, alla chiusura dell&#39;account di Lapisc o dell&#39;utente responsabile delle violazioni dei termini. L&#39;utente dichiara di comprendere e accettare che Lapsic non pu&ograve; essere e non sar&agrave; ritenuta responsabile dei Contenuti pubblicati sul social e che l&#39;uso dei servizi offerti da Lapsic avviene a proprio rischio e pericolo. In caso di inadempienza nella forma e nella sostanza delle presenti Condizioni d&#39;uso da parte dell&#39;utente o qualora questi sia causa di rischi legali per Lapsic, abbiamo la facolt&agrave; di bloccare &nbsp;l&rsquo;erogazione di parte o di tutti i servizi nei confronti dell&#39;utente stesso.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Linee guida della comunit&agrave;</h2>\r\n\r\n<h3>Versione breve</h3>\r\n\r\n<p>Desideriamo che Lapsic sia un luogo di condivisione sicuro in cui gli utenti possano trovare ispirazione ed esprimersi. Aiutaci a far crescere questa comunit&agrave;. Pubblica solo le tue foto e rispetta sempre le leggi. Rispetta tutti su Lapsic, non inviare spam &nbsp;alle persone e non pubblicare contenuti di nudo.</p>\r\n\r\n<h3>Versione lunga</h3>\r\n\r\n<p>Lapsic rispecchia la nostra eterogenea comunit&agrave; di culture, et&agrave; e credenze. Abbiamo dedicato molto tempo a riflettere sui diversi punti di vista delle persone in modo da creare un ambiente sicuro e aperto per tutti.</p>\r\n\r\n<p>Abbiamo creato le Linee guida della comunit&agrave; Lapsic per permetterti di aiutarci a promuovere e proteggere questa splendida comunit&agrave;. Usando Lapsic, accetti le presenti linee guida e le nostre&nbsp;Condizioni d&#39;uso. Garantiamo il nostro totale rispetto delle presenti &nbsp;linee guida e ci auguriamo che lo faccia anche tu. Il mancato rispetto dei limiti stabiliti e delle condizioni d&rsquo;uso potrebbe comportare la&nbsp;disattivazione dell&#39;account.</p>\r\n\r\n<p>&sect;&nbsp; Condividi solo le foto acquisite da te o che hai il diritto di condividere.</p>\r\n\r\n<p>Come sempre, sei titolare e responsabile &nbsp;dei contenuti che pubblichi su Lapsic. Ricorda di pubblicare contenuti autentici e non elementi copiati o scaricati da Internet che non hai il diritto di pubblicare.</p>\r\n\r\n<p>&sect;&nbsp; Carica foto adatte per un pubblico eterogeneo.</p>\r\n\r\n<p>Sappiamo che talvolta le persone desiderano condividere immagini di nudo artistiche o di natura creativa, ma per diversi motivi non &egrave; consentita la pubblicazione di contenuti di nudo su Lapsic. Sono inclusi le foto e altri contenuti creati con strumenti digitali che mostrano rapporti sessuali, genitali. Sono incluse anche le foto di capezzoli femminili, mentre sono accettate le foto di cicatrici causate da una mastectomia e donne che allattano al seno. Le foto di dipinti e sculture con immagini di nudo sono pubblicabili.</p>\r\n\r\n<p>Alle persone piace condividere le foto dei loro bambini. Tuttavia, per motivi di sicurezza, cancelliamo le foto di bambini totalmente o parzialmente nudi. Ci&ograve; perch&eacute;, anche qualora venissero pubblicate con tutte le buone intenzioni del caso, alcuni utenti potrebbero usarli in modo non appropriato o fuori termini di legge.</p>\r\n\r\n<p>&sect;&nbsp; Promuovi condivisioni significative e sincere.</p>\r\n\r\n<p>Per aiutarci a evitare lo spam, non raccogliere in modo artificiale &quot;tempo donato&quot;, seguaci o condivisioni.</p>\r\n\r\n<p>&sect;&nbsp; Rispetta la legge.</p>\r\n\r\n<p>Lapsic non &egrave; un luogo adatto per sostenere o fomentare il terrorismo, il crimine organizzato o i gruppi inneggianti all&#39;odio. Non &egrave; consentito offrire servizi sessuali, vendere o acquistare sostanze illegali o medicinali con obbligo di ricetta e promuovere l&rsquo;uso di droghe a scopo ludico. Ricorda di rispettare sempre la legge quando vendi o acquisti beni soggetti a limitazioni legali, compresi armi da fuoco, alcol e tabacco.</p>\r\n\r\n<p>Non tolleriamo assolutamente la condivisione di contenuti di natura &nbsp;sessuale in cui sono presenti minorenni o le minacce di pubblicazione di foto intime di altri utenti e persone.</p>\r\n\r\n<p>&sect;&nbsp; Rispetta gli altri membri della comunit&agrave; di Lapsic.</p>\r\n\r\n<p>Nostro obiettivo &egrave; costruire una comunit&agrave; positiva ed eterogenea. Cancelliamo i contenuti che presentano minacce credibili o discorsi di incitazione all&#39;odio, i contenuti diretti a singoli individui con lo scopo di umiliarli od imbarazzarli, le informazioni personali destinate a ricattare o infastidire qualcuno od estorcere denaro o prestazioni, &nbsp;e i messaggi indesiderati inviati pi&ugrave; volte. In linea di massima, tolleriamo conversazioni pi&ugrave; taglienti nei confronti di persone che sono menzionate dai mass media oche godono &nbsp;una grande attenzione da parte del pubblico per le loro attivit&agrave; professionali, il loro impegno politico o di altro tipo.</p>\r\n\r\n<p>Non condividiamo in alcun caso l&rsquo;esaltazione della violenza o gli insulti fondati su razza, nazionalit&agrave;, etnia, sesso, identit&agrave; o orientamento sessuale, affiliazione religiosa, disabilit&agrave; o malattia. Le frasi di incitazione all&#39;odio condivisi per metterli in discussione o per sensibilizzare le persone potrebbero essere accettati. In questi casi, ti chiediamo di indicare chiaramente il tuo intento.</p>\r\n\r\n<p>Non sono permesse le minacce reali alla sicurezza collettiva e personale. Sono incluse le minacce specifiche di danni fisici e di furto, atti di vandalismo e altri danni economici. Controlliamo con scrupolosa attenzione le segnalazioni relative alle minacce e prendiamo in considerazione diversi fattori per valutare se si tratti di una minaccia credibile o meno.</p>\r\n\r\n<p>&sect;&nbsp; Evita di elogiare gli atti di autolesionismo.</p>\r\n\r\n<p>La comunit&agrave; di Lapsic accoglie membri solidali gli uni con gli altri ed &egrave; uno spazio in cui le persone che affrontano difficolt&agrave; serie come disturbi dell&#39;alimentazione o tipi di autolesionismo diversi si incontrano per discuterne o cercare sostegno. Da parte nostra, ci auguriamo che le persone che attraversano tali momenti di difficolt&agrave; possano superare questa fase, anche grazie ad il supporto dato loro dai servizi Lapsic.</p>\r\n\r\n<p>Incoraggiare o spingere le persone a compiere atti di autolesionismo non &egrave; in linea con questo ambiente di supporto, di conseguenza cancelleremo i contenuti di questo tipo o disabiliteremo gli account che ci vengano segnalati. Per proteggere le persone, potremmo anche rimuovere i contenuti in cui vengono identificate le vittime o le persone che hanno avuto problemi di autolesionismo se tali contenuti hanno lo scopo di attaccarle, deriderle o denigrarle.</p>\r\n\r\n<p>&sect;&nbsp; Pensa prima di pubblicare fatti che reputi interessanti.</p>\r\n\r\n<p>Sappiamo che molte persone usano Lapsic per condividere notizie importanti e interessanti. Talune potrebbero contenere immagini forti. Dato che molte persone diverse e di varie et&agrave; usano Lapsic, potremmo rimuovere le foto particolarmente violenti per assicurarci che Lapsic risulti sempre un ambiente adeguato per tutte le foto.</p>\r\n\r\n<p>Comprendiamo che le persone spesso condividono questo tipo di contenuti per condannarli o sensibilizzare le persone. Se condividi i contenuti per tale motivo, ti invitiamo a inserire una didascalia nella foto che informi le persone della presenza di immagini violente e del tuo effettivo pensiero. Non &egrave; concessa la condivisione di immagini forti per ragioni sadiche o come inno alla violenza.</p>\r\n\r\n<p>Aiutaci a creare una comunit&agrave; forte e stabile:</p>\r\n\r\n<ul>\r\n	<li>ogni utente svolge un ruolo importante nella comunit&agrave; di Lapsic. Se vedi qualcosa che, a tuo parere, non rispetta le nostre linee guida, aiutaci usando la nostra&nbsp;opzione di segnalazione. Ci avvaliamo di un team che controlla queste segnalazioni e lavora nel modo pi&ugrave; veloce possibile per rimuovere i contenuti che non rispettano le nostre linee guida. Anche le persone che non hanno un account Lapsic possono&nbsp;inviare una segnalazione. Quando invii una segnalazione, cerca di fornire il maggior numero di informazioni possibile, come link, nomi utente e descrizioni dei contenuti, per consentirci di trovare e controllare i contenuti in maniera rapida.</li>\r\n	<li>Potresti imbatterti in contenuti che non ti piacciono ma che rispettano le linee guida della comunit&agrave;.</li>\r\n	<li>Molte controversie e incomprensioni possono essere risolte direttamente tra i membri della comunit&agrave; Lapsic. Se qualcun altro ha pubblicato una delle tue foto, puoi provare a commentare il post chiedendo alla persona di rimuoverlo. Se non funziona, puoi sempre&nbsp;inviare una segnalazione di violazione del copyright&nbsp;per consentirci di esaminare la questione. Invece, se ritieni che qualcuno non stia rispettando il tuo marchio commerciale registrato, puoi&nbsp;inviare una segnalazione di violazione del marchio. Non attaccare la persona che ha pubblicato il contenuto condividendo gli screenshot e attirando l&#39;attenzione sull&#39;episodio perch&eacute; potrebbe essere classificato come un comportamento offensivo.</li>\r\n	<li>Al fine di garantire la sicurezza della comunit&agrave;, possiamo collaborare con le forze di polizia, ad esempio nei casi in cui, a nostro giudizio, vi &egrave; il rischio di danni fisici o minacce alla sicurezza pubblica.</li>\r\n</ul>\r\n\r\n<p>Per maggiori informazioni consulta le&nbsp;Condizioni d&#39;uso.</p>\r\n\r\n<p>Grazie per il contributo che ci offri nella creazione della nostra comunit&agrave;, per il tempo dedicatoci ed il &ldquo;tempo donato&rdquo;.</p>\r\n\r\n<p>Il team di Lapsic.</p>\r\n', 0, '', 'logo.png', '0.2', '0.2', '2014-01-01 15:00:00', 1, '2014-01-01 15:00:00', 1);
