DROP TRIGGER IF EXISTS `UPDATE_counter`;
DELIMITER //
CREATE TRIGGER `UPDATE_counter` AFTER UPDATE ON `lapsic_hashtag_relationship`
 FOR EACH ROW BEGIN
 DECLARE v_id  INT(10);
 DECLARE v_type  VARCHAR(255);
 DECLARE v_conteggio INT(30);
 DECLARE v_id_user_source INT(10);
 DECLARE v_id_user_dest INT(10);
 DECLARE v_user_source VARCHAR(255);
 DECLARE v_user_dest VARCHAR(255);
    
 DECLARE data_cursor CURSOR FOR 
 SELECT id_user_source AS id_user, COUNT(id_user_source) AS conteggio, 'source' AS tipo FROM lapsic_notification WHERE type = 'timer'  GROUP BY id_user_source
 UNION
 SELECT id_user_dest AS id_user, COUNT(id_user_dest) AS conteggio, 'dest' AS tipo FROM lapsic_notification WHERE type = 'timer'  GROUP BY id_user_dest
 UNION
 SELECT id_owner AS id_user, SUM( (UNIX_TIMESTAMP(time_left) - UNIX_TIMESTAMP(utc_timestamp())) ) AS conteggio, 'time' AS tipo FROM lapsic_photo WHERE time_left > utc_timestamp() AND time_left <> '0000-00-00 00:00:00' GROUP BY id_owner;
 
 -- declare NOT FOUND handler
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET @done = 1;
 
 SET @Random = (SELECT FLOOR(RAND() * 401) + 100);

 -- dichiaro e setto le variabili interne
 set @done = 0;
 SET @loop_cntr = 0;
 SET @media_prec = 0;
 
 OPEN data_cursor;
 
 get_data: LOOP
 
 -- faccio partire il loop sul cursore dei dati prelevati dal db
 FETCH data_cursor INTO v_id, v_conteggio, v_type;
 
 IF @done = 1 THEN 
 LEAVE get_data;
 END IF;

 -- INSERT INTO debug (`text_debug`,`id_proc`) VALUES ('PARTENZA - tipo: '+v_type+' - conteggio: '+v_conteggio+' - id: '+v_id, @Random);
 
 
 -- SET @time_left = ( SELECT notify_to_text(v_type, v_id_record, v_user_source) );
 IF v_type = 'source' THEN
 
	UPDATE lapsic_user SET `timers` = v_conteggio WHERE `id` = v_id;  
    -- SET @qry = CONCAT('UPDATE lapsic_user SET `timers` = ',v_conteggio,' WHERE `id` = ',v_id,';');
	-- INSERT INTO debug (`text_debug`,`id_proc`) VALUES (@qry, @Random);
 
 ELSEIF v_type = 'dest' THEN
  
	UPDATE lapsic_user SET `timing` = v_conteggio WHERE `id` = v_id; 
    -- SET @qry = CONCAT('UPDATE lapsic_user SET `timing` = ',v_conteggio,' WHERE `id` = ',v_id,';');
	-- INSERT INTO debug (`text_debug`,`id_proc`) VALUES (@qry, @Random);
    
 ELSEIF v_type = 'time' THEN
  
	UPDATE lapsic_user SET `time_left` = from_unixtime(unix_timestamp()+v_conteggio, '%Y-%m-%d %H:%i:%s') WHERE `id` = v_id; 
    -- SET @qry = CONCAT('UPDATE lapsic_user SET `time_left` = ',from_unixtime(unix_timestamp()+v_conteggio, '%Y-%m-%d %H:%i:%s'),' WHERE `id` = ',v_id,';');
	-- INSERT INTO debug (`text_debug`,`id_proc`) VALUES (@qry, @Random);
    
 END IF;
 
 END LOOP get_data;
 
 CLOSE data_cursor;
    END
//
DELIMITER ;

