--
-- Trigger `lapsic_photo`
--
DROP TRIGGER IF EXISTS `UPDATE_new_photo`;
DELIMITER //
CREATE TRIGGER `UPDATE_new_photo` AFTER UPDATE ON `lapsic_photo`
 FOR EACH ROW BEGIN
    
		DECLARE v_id  INT(10);
        DECLARE v_n  INT(20);
        
		DECLARE data_cursor CURSOR FOR 	
		SELECT id_owner, SUM( (UNIX_TIMESTAMP(time_left) - UNIX_TIMESTAMP(utc_timestamp()) ) ) AS sumdata
		FROM lapsic_photo
		WHERE time_left <> '0000-00-00 00:00:00' AND time_left > utc_timestamp()
		GROUP BY id_owner
        UNION        
		SELECT U.id AS id_user, 0 AS conteggio
		FROM lapsic_user AS U 
		LEFT JOIN lapsic_photo AS P ON U.id = P.id_owner
		WHERE (P.time_left = '0000-00-00 00:00:00' OR P.time_left <= utc_timestamp() OR P.time_left IS NULL) AND U.id NOT IN ( 
											SELECT id_owner
											FROM lapsic_photo
											WHERE time_left <> '0000-00-00 00:00:00' AND time_left > utc_timestamp()
											)
		GROUP BY U.id
		ORDER BY sumdata DESC;
        
        


		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET @done = 1;

		
		set @done = 0;
		SET @loop_cntr = 0;
		SET @sum_prec = 1;
		SET @Random = (SELECT FLOOR(RAND() * 401) + 100);

		OPEN data_cursor;

        
		get_data: LOOP
            
		
		FETCH data_cursor INTO v_id, v_n;

		IF @done = 1 THEN         
		
		LEAVE get_data;
		END IF;
        
			UPDATE lapsic_user SET `rank` = @sum_prec WHERE `id` = v_id;

			SET @qry = CONCAT('UPDATE lapsic_user SET `rank` = ',@sum_prec,' WHERE `id` = ',v_id,';');
            
			SET @sum_prec = @sum_prec+1;
		END LOOP get_data;

		CLOSE data_cursor;
        UPDATE `dashboard_log_azioni` SET data_creation = current_timestamp() WHERE id_action = 9999;
    END
//
DELIMITER ;

